    <Link to ="/"k> <img src='Icons/home.png' alt='Home Icon' /></Link>
      <h2>Hakkımızda</h2>
      <img className={HeaderCSS.Logo}src="https://drive.google.com/thumbnail?id=1BkxphvBw503_fWpTwWS0QMzkZvv3eyo4" alt="UniSkor Yatay Logo"/> 
      <h2 >İletişim</h2>

